import SlickSlider from "../../slickSlider/SlickSlider";
import Card from "./Common_page/homeLayout/Card";
const Home = () => {
  return (
    <>
      <Page name="Home Page !" />
      <SlickSlider />
      <Card />
      <pre>
        <code>
          &lt;p&gt;Sample text here...&lt;/p&gt; &lt;p&gt;And another line of
          sample text here...&lt;/p&gt;
        </code>
      </pre>
    </>
  );
};

export default Home;
